import React, { useEffect, useRef, useState } from 'react';

function DevelopingFutureStars() {
  const [isVisible, setIsVisible] = useState(false);
  const imageRef = useRef();

  useEffect(() => {
    const observer = new IntersectionObserver(
      ([entry]) => {
        setIsVisible(entry.isIntersecting);
      },
      {
        threshold: 0.2, // The image becomes visible when 20% is in view
      }
    );

    if (imageRef.current) {
      observer.observe(imageRef.current);
    }

    return () => {
      if (imageRef.current) {
        observer.unobserve(imageRef.current);
      }
    };
  }, []);

  return (
    <section className="relative pb-16 bg-custom-cloud"> {/* Added padding at the top to accommodate the cloud */}
      
      {/* Cloud Shape SVG Positioned at the top */}
      <div className="absolute top-0 left-0 w-full">
        <svg
          viewBox="0 0 1440 160" // Adjusted height
          xmlns="http://www.w3.org/2000/svg"
          className="w-full h-full"
        >
          <path
            fill="#f8f6ee" // Cloud color, you can change it
            d="M0,128L48,112C96,96,192,64,288,64C384,64,480,96,576,117.3C672,139,768,149,864,144C960,139,1056,117,1152,96C1248,75,1344,53,1392,42.7L1440,32L1440,0L1392,0C1344,0,1248,0,1152,0C1056,0,960,0,864,0C768,0,672,0,576,0C480,0,384,0,288,0C192,0,96,0,48,0L0,0Z"
          />
        </svg>
      </div>

    {/* Content Section Below the Cloud */}
        <div className="min-h-screen max-w-screen-xl mx-auto px-4 flex flex-col md:flex-row items-end pb-20">
        {/* Image Section */}
        <div className="w-full md:w-1/2 flex justify-center mb-12">
          {/* Image without container cropping */}
          <img
            ref={imageRef}
            src={`${process.env.PUBLIC_URL}/Photos/Dstar_logo.png`} // Adjust the image path as needed
            alt="Developing Future Stars"
            className={`pb-12 transition-opacity duration-2000 ${isVisible ? 'opacity-100' : 'opacity-0'}`}
            style={{ 
              transition: 'opacity 1s ease-in-out', // Smooth transition effect
              transform: 'rotate(-5deg)' // Tilt image slightly to the left
            }}
          />
        </div>

        {/* Text Section (Post-it Note Style) */}
        <div className="relative w-full md:w-1/2 ml-8 pt-10">
          <div className="absolute top-0 left-0 w-full h-full bg-black opacity-10 transform -rotate-1 z-0"></div> {/* Depth effect shadow */}
            <div className="relative bg-custom-beige p-6 shadow-lg transform rotate-2 z-10">
                <h2 className="text-4xl font-bold text-black mb-4">Developing Future Stars</h2> {/* Increased font size */}
                <p className="text-2xl text-gray-700 mb-4">
                Upon entering pre-school, usually children will bring with them a variety of personal and social skills, values, and attitudes. No matter how little these are, it is important that they foster these values and from the relationships and experiences within the home and immediate environment, we will help them to cultivate their learning environment.
                </p>
                <p className="text-3xl text-gray-700 text-center"> {/* Increased font size */}
                We provide classes for:
                </p>
            </div>
        </div>
        </div>

    {/* Sticky Notes Section */}
<section className="relative pb-16 bg-custom-cloud">
  {/* Sticky Notes Section */}
  <div className="max-w-screen-xl mx-auto grid grid-cols-1 md:grid-cols-2 gap-12">
    
    {/* Sticky Note 1 */}
    <div className="relative w-full flex justify-center">
      {/* Depth effect shadow */}
      <div className="absolute top-2 w-[28rem] h-full mr-5 bg-black opacity-10 transform rotate-2 rounded-md ml-12"></div>
      <div className="relative w-[28rem] h-auto p-12 bg-custom-beige rounded-md shadow-2xl transform rotate-3 hover:rotate-1 transition-all duration-500 ml-12 text-center"> {/* Increased width and padding */}
        <h3 className="text-4xl font-bold">After School Care Service</h3> {/* Increased font size */}
        <p className="mt-4 text-xl text-gray-700"> {/* Increased font size */}
          DStar is committed to providing the highest level of before-after school care to your child. We aim to be a one-stop educational center that fulfills the learning needs of your child.
        </p>
      </div>
    </div>

    {/* Sticky Note 2 */}
    <div className="relative w-full flex justify-center">
      {/* Depth effect shadow */}
      <div className="absolute top-2 ml-5 w-[28rem] h-full bg-black opacity-10 transform -rotate-2 rounded-md"></div>
      <div className="relative w-[28rem] h-auto p-12 bg-custom-beige rounded-md shadow-2xl transform -rotate-2 hover:-rotate-1 transition-all duration-500 text-center"> {/* Increased width and padding */}
        <h3 className="text-4xl font-bold">Tuition Service</h3> {/* Increased font size */}
        <p className="mt-4 text-xl text-gray-700"> {/* Increased font size */}
          DStar provides tuition from Primary 1 onwards. Speak with our consultant today. Our tuition teachers are highly qualified (some ex-school teachers).
        </p>
      </div>
    </div>

    {/* Sticky Note 3 */}
    <div className="relative w-full flex justify-center">
      {/* Depth effect shadow */}
      <div className="absolute top-2 mr-5 w-[28rem] h-full bg-black opacity-10 transform rotate-4 rounded-md"></div>
      <div className="relative w-[28rem] h-auto p-12 bg-custom-beige rounded-md shadow-2xl transform rotate-4 hover:rotate-2 transition-all duration-500 text-center"> {/* Increased width and padding */}
        <h3 className="text-4xl font-bold">Enrichment Program</h3> {/* Increased font size */}
        <p className="mt-4 text-xl text-gray-700"> {/* Increased font size */}
          DStar offers event-based classes like creative writing, robotics tryouts, and other exciting activities to enrich your child's learning experience.
        </p>
      </div>
    </div>

    {/* Sticky Note 4 */}
    <div className="relative w-full flex justify-center">
      {/* Depth effect shadow */}
      <div className="absolute top-2 mr-5 w-[28rem] h-full bg-black opacity-10 transform -rotate-2 rounded-md"></div>
      <div className="relative w-[28rem] h-auto p-12 bg-custom-beige rounded-md shadow-2xl transform -rotate-3 hover:-rotate-2 transition-all duration-500 mr-10 text-center"> {/* Increased width and padding */}
        <h3 className="text-4xl font-bold">School Holiday Program</h3> {/* Increased font size */}
        <p className="mt-4 text-xl text-gray-700"> {/* Increased font size */}
          DStar offers full-day care programs during school holidays to keep your child engaged and learning while having fun!
        </p>
      </div>
    </div>

  </div>
</section>


    </section>
  );
}

export default DevelopingFutureStars;
